export const nameAction = (data) => {
  return { type: 'NAME_INPUT', payload: data };
};
export const dobAction = (data) => {
  return { type: 'DATE_OF_BIRTH', payload: data };
};
export const classAction = (data) => {
  return { type: 'CLASS_INPUT', payload: data };
};
